def bmh(padrao, texto):
    d = [] #deslocamento
    m = len(padrao) #tamanho da palavra padrão para busca
    n = len(texto)#tamanho do texto de referência
    cont = 0
    #print("Iniciando o algoritmo de BMH")
    for j in range(256):
        # Adicionar o valor de deslocamento m no alfabeto tendo em mente a tabela ASCII,
        # inicialmente é igual a m para todos
        d.append(m)
    for j in range(m-1):
        #atualiza os valores da tabela de deslocamento para os caracteres encontrados no padrão
        d[ord(padrao[j])] = m - j - 1
    i = m-1
    while i < n: #enquanto i for menor que o tamanho do texto
        k = i
        j = m - 1
        while (j >= 0) and (ord(texto[k]) == ord(padrao[j])):#casando os sufixos
            j = j - 1
            k = k - 1
        if j < 0:
            #print("Casamento na posição: ",(k + 1))
            cont = cont + 1
        i = i + d[ord(texto[i])] # Faz os deslocamentos no texto de referência de acordo
        # com a posição do ultimo caractere do padrão.
    #print("BMH - Quantidade de ocorrêcias encontradas: ",cont)

def bmhs(padrao, texto):
    d = [] #deslocamento
    m = len(padrao) #tamanho da palavra padrão para busca
    n = len(texto)#tamanho do texto de referência
    cont = 0
    #print("Iniciando o algoritmo de BMHS")
    for j in range(256):
        # Adicionar o valor de deslocamento m no alfabeto tendo em mente a tabela ASCII,
        # inicialmente é igual a m + 1 para todos
        d.append(m + 1)
    for j in range(m):
        #atualiza os valores da tabela de deslocamento para os caracteres encontrados no padrão
        d[ord(padrao[j])] = m - j
    i = m-1
    while i < n: #enquanto i for menor que o tamanho do texto
        k = i
        j = m - 1
        while (j >= 0) and (ord(texto[k]) == ord(padrao[j])):#casando os sufixos
            j = j - 1
            k = k - 1
        if j < 0:
            #print("Casamento na posição: ",(k + 1))
            cont = cont + 1
        try:
            i = i + d[ord(texto[i+1])] # Faz os deslocamentos no texto de referência de acordo
        except (IndexError):
            break
        # com a posição do ultimo caractere do padrão.
    #print("BMHS - Quantidade de ocorrêcias encontradas: ", cont)

def shiftAndExato(padrao, texto):
    m = len(padrao)  # tamanho da palavra padrão para busca
    n = len(texto)  # tamanho do texto de referência
    cont = 0
    r = 0
    M = []
    #print("Iniciando o algoritmo de Shit-and-Exato")
    for j in range(256):
        # Adicionar o valor de deslocamento m no alfabeto tendo em mente a tabela ASCII,
        # inicialmente é igual a 0 para todos
        M.append(0)
    for j in range(m):
        M[ord(padrao[j])] = M[ord(padrao[j])] | (1 << (m-j-1))
    i = 0
    for i in range(n):
        r = ((r >> 1) | (1 << (m - 1))) & M[ord(texto[i])]
        if ((r & 1) != 0):
            #print("Casamento na posição: ", (i - m + 1))
            cont = cont + 1
    #print("Shift and Exato - Quantidade de ocorrêcias encontradas: ", cont)

def shiftAndAproximado(padrao, texto, k):
    m = len(padrao)  # tamanho da palavra padrão para busca
    n = len(texto)  # tamanho do texto de referência
    cont = 0
    #Pré processamnto
    R = []
    M = []
    #print("Iniciando o algoritmo de Shit-and-Aproximado")
    for i in range(k+1):
        R.append(0)
    for j in range(256):
        # Adicionar o valor no alfabeto tendo em mente a tabela ASCII,
        # inicialmente é igual a 0 para todos
        M.append(0)
    for j in range(m):
        M[ord(padrao[j])] = M[ord(padrao[j])] | (1 << (m-j-1))
    #Pesquisa
    Ri = 1 << (m-1)
    R[0] = 0
    for j in range(1,k+1):
        R[j] = (1 << (m-j)) | R[j-1]
    for i in range(n):
        Rant = R[0]
        Rnovo = ((Rant >> 1) | Ri) & M[ord(texto[i])]
        R[0] = Rnovo
        for z in range(1,k+1):
            Rnovo = ((R[z] >> 1) & M[ord(texto[i])]) | Rant | ((Rant | Rnovo) >> 1)
            Rant = R[z]
            R[z] = Rnovo | Ri
        if((Rnovo & 1) != 0):
            #print("Casamento na posição: ", i)
            cont = cont + 1
    #print("Shift and Aproximado - Quantidade de ocorrêcias encontradas: ", cont)





